						["custom"] = "function(allstates, event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timestamp, subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, _,_, auraType = ...\n        if subEvent == \"SPELL_AURA_APPLIED\"\n        and (spellID == 365021 or spellID == 367632) then\n            aura_env.counter = aura_env.counter + 1\n            if destGUID == WeakAuras.myGUID then\n                local _, _, _, _, duration, expirationTime = GetPlayerAuraBySpellID(spellID)\n                local count = aura_env.counter\n                allstates[destGUID] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = duration,\n                    expirationTime = expirationTime,\n                    name = count <= 3 and aura_env.config.first or count > 3 and count < 7 and aura_env.config.second or aura_env.config.third,\n                    autoHide = true,\n                    spam = count <= 3 and \"1\" or count > 3 and count <7 and \"2\" or \"3\"\n                }\n                return true\n            end\n        elseif subEvent == \"SPELL_AURA_REMOVED\"\n        and (spellID == 365021 or spellID == 367632) then\n            local state = allstates[destGUID]\n            if state then\n                state.show = false\n                state.changed = true\n                return true\n            end\n        elseif subEvent == \"SPELL_CAST_SUCCESS\"\n        and (spellID == 365030 or spellID == 367631) then\n            aura_env.counter = 0\n        end\n    elseif event == \"ENCOUNTER_START\" then\n        aura_env.counter = 0\n    end\nend",
