						["custom"] = "function(s, e, ...)\n    \n    if e == \"ENCOUNTER_START\" or e == \"ENCOUNTER_END\" then\n        aura_env.active = false\n    elseif e == \"UNIT_SPELLCAST_START\" then\n        local u, cast, spellID = ... -- Unit event\n        if spellID == 350687 then\n            local endtime = select(5, UnitCastingInfo(u))\n            for _, v in pairs(s) do\n                v.progressType = \"timed\"\n                v.duration = endtime/1000 - GetTime()\n                v.expirationTime = endtime/1000\n                v.changed = true\n                v.display = true\n            end\n            return true\n        end\n    elseif e == \"UNIT_SPELLCAST_SUCCEEDED\" then\n        local u, cast, spellID = ... -- Unit event\n        if spellID == 350745 then\n            aura_env.active = true\n        elseif spellID == 350687 then\n            if s[\"Aradne\"] then\n                WeakAuras.ScanEvents(\"RELOE_ARADNE_CALL\", true)\n            end\n            C_Timer.After(3, function()\n                    WeakAuras.ScanEvents(\"RELOE_DELAYED_STATE\", true)\n            end)\n        end\n    elseif e == \"CHAT_MSG_MONSTER_YELL\" then\n        local _, yell = ...\n        if aura_env.yells[yell] and aura_env.active then\n            s[yell] = {\n                show = true,\n                changed = true,\n                progressType = \"static\",\n                value = 0,\n                total = 100,\n                display = false,\n                text = aura_env.yells[yell][1],\n                icon = aura_env.yells[yell][2],\n            }\n            return true\n        end\n        \n    elseif e == \"RELOE_DELAYED_STATE\" and ... then\n        for _, v in pairs(s) do\n            v.show = false\n            v.changed = true\n        end\n        return true\n    end \nend",
