						["custom"] = "function(allstates, event, unit)\n    if event == \"UNIT_AURA\" then\n        for k,v in pairs(allstates) do\n            v.show = false\n            v.changed = true\n        end\n        for i = 1, 255 do\n            local name, icon, count, debuffType, duration, expirationTime, source, isStealable, \n            nameplateShowPersonal, spellId = UnitDebuff(unit, i)\n            if not name then break end\n            if spellId == 358711\n            and UnitExists(source) then\n                allstates[source] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = duration,\n                    expirationTime = expirationTime,\n                    unit = source,\n                    autoHide = true,\n                }\n            end\n        end\n        return true\n    elseif event == \"NAME_PLATE_UNIT_ADDED\"\n    and unit then\n        for i = 1, 255 do\n            local name, icon, count, debuffType, duration, expirationTime, source, isStealable, \n            nameplateShowPersonal, spellId = UnitDebuff(\"player\", i)\n            if not name then break end\n            if spellId == 358711\n            and unit == source then\n                allstates[unit] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = duration,\n                    expirationTime = expirationTime,\n                    unit = unit,\n                    autoHide = true,\n                }\n            end\n        end\n        return true\n    elseif event == \"NAME_PLATE_UNIT_REMOVED\"\n    and unit then\n        if allstates[unit] then\n            allstates[unit].show = false\n            allstates[unit].changed = true\n            return true\n        end\n    end\nend",
