						["custom"] = "function(allstates, event, ...)\n    if event == \"UNIT_SPELLCAST_START\"\n    and aura_env.assigned then\n        local _ , _, spellID = ...\n        if spellID == 362390 then\n            aura_env.counter = aura_env.counter + 1\n            if aura_env.counter > aura_env.config.reset then\n                aura_env.counter = 1\n            end\n            if aura_env.assignments[aura_env.myGroup][aura_env.counter] == WeakAuras.me\n            then\n                local assignment = aura_env.groups[aura_env.myGroup]\n                if assignment then\n                        allstates[\"cosmos\"] = {\n                            show = true,\n                            changed = true,\n                            name = assignment,\n                            progressType = \"timed\",\n                            duration = 4,\n                            expirationTime = 4 + GetTime(),\n                            autoHide = true,\n                        }\n                        return true\n                end\n            end\n        end\n    elseif event == \"ENCOUNTER_START\" then\n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\")) \n        and _G.VExRT.Note.Text1 then\n            local text = _G.VExRT.Note.Text1\n            aura_env.counter = 0\n            aura_env.assigned = nil\n            aura_env.assignments = {}\n            aura_env.myGroup = nil\n            aura_env.myNum = nil\n            local groupNum = 0\n            for line in text:gmatch('[^\\r\\n]+') do\n                if line:match(\"^close\") \n                or line:match(\"^center\")\n                or line:match(\"^far\") then\n                    local num = 0\n                    groupNum = groupNum + 1 -- 1 = close, 2 = center, 3 = far\n                    aura_env.assignments[groupNum] = {}\n                    for name in line:gmatch(\"|c%x%x%x%x%x%x%x%x([^|]+)|\") do\n                        num = num + 1\n                        aura_env.assignments[groupNum][num] = name\n                        if name == WeakAuras.me then\n                            aura_env.assigned = true\n                            aura_env.myGroup = groupNum\n                            aura_env.myNum = num\n                        end\n                    end\n                end\n            end\n        end\n    end\nend",
