						["custom"] = "function(allstates, event, ...)\n    if event == \"ENCOUNTER_START\" then\n        aura_env.votes = {}\n        aura_env.cleared = {}\n        aura_env.GUID2Unit = {}\n        \n        for unit in WA_IterateGroupMembers() do\n            aura_env.GUID2Unit[UnitGUID(unit)] = unit\n        end\n    elseif event == \"UNIT_SPELLCAST_START\" then\n        local _, _, spellID = ...\n        \n        if spellID == 360717 then\n            aura_env.votes = {}\n            aura_env.cleared = {}\n            \n            for _, state in pairs(allstates) do\n                state.show = false\n                state.changed = true\n            end\n            \n            return true\n        end\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\n        \n        if subEvent == \"SPELL_AURA_APPLIED\" and spellID == 361502 then\n            aura_env.cleared[destGUID] = true\n            local s = allstates[destGUID]\n            \n            if s then\n                s.show = false\n                s.changed = true\n                \n                return true\n            end\n        end\n    elseif event == \"CHAT_MSG_ADDON\" then\n        local prefix, GUID, _, sender = ...\n        \n        if prefix == \"BDGG_AMOGUS\" and GUID then\n            if not aura_env.votes[GUID] then\n                aura_env.votes[GUID] = {count = 0, voters = {}}\n            end\n            \n            if aura_env.votes[GUID].voters[sender] then return end -- The sender already voted on this player before\n            \n            aura_env.votes[GUID].count = aura_env.votes[GUID].count + 1\n            aura_env.votes[GUID].voters[sender] = true\n            \n            if aura_env.votes[GUID].count >= 3 and not aura_env.cleared[GUID] then\n                allstates[GUID] = {\n                    show = true,\n                    changed = true,\n                    unit = aura_env.GUID2Unit[GUID],\n                    autoHide = false\n                }\n                \n                return true\n            end\n        end\n    end\nend",
