						["unit"] = "player",
						["subeventPrefix"] = "SPELL",
						["custom"] = "function(allstates, event, unit, ...)\n    if event == \"UNIT_AURA\" and unit then\n        for i = 1, 255 do\n            local spellId = select(10, UnitDebuff(unit, i))\n            if not spellId then break end\n            if (spellId  == 368738 or spellId == 368740) and not UnitIsDeadOrGhost(unit) then\n                local name = UnitName(unit)\n                if name then\n                    local state = allstates[name]\n                    if state then\n                        state.name = spellId == 368738 and string.format(\"|cffffbf00%s|r\", name) or spellId == 368740 and string.format(\"|cFF5695ff%s|r\", name)\n                        state.changed = true\n                        return true   \n                    end\n                end\n            end\n        end\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent, _, _, _, _, _, _, destName = ...\n        if subEvent == \"UNIT_DIED\" then\n            local state = allstates[destName]\n            if state then\n                state.name = \"|cFFFF0000dead|r\"\n                state.changed = true\n                return true\n            end\n        end\n    elseif event == \"EXRT_NOTE_UPDATE\"\n    or event == \"ENCOUNTER_START\" then\n        local text = _G.VExRT.Note.Text1\n        if (IsAddOnLoaded(\"ExRT\") or IsAddOnLoaded(\"MRT\"))\n        and text then\n            local text = _G.VExRT.Note.Text1\n            local num = 0\n            local markIndex = 0\n            for _, v in pairs(allstates) do\n                v.show = false\n                v.changed = true\n            end\n            for line in text:gmatch('[^\\r\\n]+') do\n                local mark = line:match(\"^{([^}]+)}\")\n                if mark and aura_env.translateERT[mark] then\n                    local markNum = ICON_TAG_LIST[mark]\n                    allstates[markNum] = {\n                        show = true,\n                        changed = true,\n                        name = ICON_LIST[markNum]..\"16|t\",\n                        index = num + markIndex\n                    }\n                    for name in line:gmatch(\"|c%x%x%x%x%x%x%x%x([^|]+)|\") do\n                        num = num + 1\n                        allstates[name] = {\n                            show = true,\n                            changed = true,\n                            mark = markNum,\n                            name = name,\n                            index = num + markIndex\n                        }\n                    end\n                    markIndex = markIndex +1\n                end\n            end\n            return true\n        end\n    end\nend",
