		["Rune of Damnation main"] = {
			["iconSource"] = -1,
			["wagoID"] = "dVIBwt6Wi",
			["authorOptions"] = {
			},
			["preferToUpdate"] = false,
			["customText"] = "function()\n    local options = WeakAuras.IsOptionsOpen()\n    if options then\n        aura_env.sortAndOffset(true)\n    end\n    \n    return aura_env.state.name, aura_env.state.side\nend\n\n\n",
			["yOffset"] = 242,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["url"] = "https://wago.io/dVIBwt6Wi/16",
			["icon"] = true,
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["customVariables"] = "{\n    duration = true,\n    expirationTime = true,\n    player = \"bool\",\n    index = \"number\",\n}",
						["event"] = "Health",
						["unit"] = "player",
						["subeventPrefix"] = "SPELL",
						["spellIds"] = {
						},
						["events"] = "ENCOUNTER_START CLEU:SPELL_CAST_SUCCESS:SPELL_AURA_APPLIED DAMNATION_CHECK",
						["names"] = {
						},
						["check"] = "event",
						["custom"] = "function(states, event, ...)\n    if event == \"OPTIONS\" then\n        local duration = 6.8\n        states[\"\"] = {\n            name = \"Player 1\",\n            side = aura_env.sides[1][1][1],\n            icon = 4005158,\n            player = true,\n            duration = duration,\n            expirationTime = duration + GetTime(),\n            progressType = \"timed\",\n            autoHide = true,\n            changed = true,\n            show = true,\n            index = 1,\n        }\n        for i = 2, 6 do\n            states[i] = {\n                name = \"Player \"..i,\n                side = aura_env.sides[1][i][1],\n                icon = 4005158,\n                player = false,\n                duration = duration,\n                expirationTime = duration + GetTime(),\n                progressType = \"timed\",\n                autoHide = true,\n                changed = true,\n                show = true,\n                index = i,\n            }\n        end\n        local aura_env = aura_env\n        C_Timer.After(0.01, function()\n                aura_env.sortAndOffset()\n        end)\n        return true\n    end\n    \n    if event == \"ENCOUNTER_START\" and ... then\n        aura_env.MRT()\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, message, _, srcGUID, srcName, _, _, destGUID, destName, _, _, spellid = ...\n        if message == \"SPELL_CAST_SUCCESS\" then\n            if aura_env.mcasts[spellid] and not aura_env.melee[srcGUID] then\n                aura_env.melee[srcGUID] = true\n            end\n        elseif message == \"SPELL_AURA_APPLIED\" and spellid == 360281 then --Rune of Damnation\n            local theTime = GetTime()\n            if not aura_env.last or aura_env.last < theTime - 5 then\n                aura_env.last = theTime\n                \n                aura_env.sides = {\n                    [1] = { --default\n                        [1] = {\"FRONT\", 1},\n                        [2] = {\"LEFT\", 2},\n                        [3] = {\"RIGHT\", 3},\n                        [4] = {\"BACK CENTER\", 5},\n                        [5] = {\"BACK RIGHT\", 6},\n                        [6] = {\"BACK LEFT\", 4},\n                    },\n                    [2] = { --priority\n                        [1] = {\"FRONT\", 1},\n                        [2] = {\"LEFT\", 2},\n                        [3] = {\"BACK LEFT\", 4},\n                        [4] = {\"BACK CENTER\", 5},\n                        [5] = {\"BACK RIGHT\", 6},\n                        [6] = {\"RIGHT\", 3},\n                    },\n                }\n                \n                aura_env.count = 1\n                aura_env.standard = {}\n                aura_env.priority = {}\n                \n                C_Timer.After(0.2, function()\n                        WeakAuras.ScanEvents(\"DAMNATION_CHECK\", true)\n                end)\n            end\n            \n            local i = UnitInRaid(destName)\n            local unit = i and \"raid\"..i\n            if unit then\n                local combatType = aura_env.check(unit)\n                combatType = combatType or \"r\"\n                \n                if aura_env.list[unit] then\n                    table.insert(aura_env.priority, {unit, combatType, aura_env.list[unit]})\n                    \n                    local toDelete = aura_env.sides[2][aura_env.count][1]\n                    for k, v in ipairs(aura_env.sides[1]) do\n                        if v[1] == toDelete then\n                            table.remove(aura_env.sides[1], k)\n                            break\n                        end\n                    end\n                    \n                    aura_env.count = aura_env.count + 1\n                else\n                    table.insert(aura_env.standard, {unit, combatType})\n                end\n            end\n        end\n    elseif event == \"DAMNATION_CHECK\" and ... then\n        table.sort(aura_env.standard, function(a, b) return a[2] < b[2] end) --melee 1st\n        table.sort(aura_env.priority, function(a, b) return a[3] < b[3] end) --MRT note priority\n        \n        local standard = aura_env.sides[1]\n        local priority = aura_env.sides[2]\n        local index = 1\n        \n        for i, data in ipairs(aura_env.priority) do\n            local unit, combatType = data[1], data[2]\n            if unit then\n                local name = WA_ClassColorName(unit)\n                local side, pattern = priority[i][1], priority[i][2]\n                local duration = 6.8\n                states[index] = {\n                    name = name,\n                    unit = unit,\n                    side = side,\n                    icon = 4005158,\n                    player = UnitIsUnit(\"player\", unit),\n                    duration = duration,\n                    expirationTime = duration + GetTime(),\n                    progressType = \"timed\",\n                    autoHide = true,\n                    changed = true,\n                    show = true,\n                    index = index,\n                }\n                WeakAuras.ScanEvents(\"DAMNATION_ME\", unit, side, pattern)\n                index = index + 1\n            end\n        end\n        \n        for i, data in ipairs(aura_env.standard) do\n            local unit, combatType = data[1], data[2]\n            if unit then\n                local name = WA_ClassColorName(unit)\n                local side, pattern = standard[i][1], standard[i][2]\n                local duration = 6.8\n                states[index] = {\n                    name = name,\n                    unit = unit,\n                    side = side,\n                    icon = 4005158,\n                    player = UnitIsUnit(\"player\", unit),\n                    duration = duration,\n                    expirationTime = duration + GetTime(),\n                    progressType = \"timed\",\n                    autoHide = true,\n                    changed = true,\n                    show = true,\n                    index = index,\n                }\n                WeakAuras.ScanEvents(\"DAMNATION_ME\", unit, side, pattern)\n                index = index + 1\n            end\n        end\n        \n        return true\n    end\nend",
