						["custom"] = "function(allstates, event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local timestamp, subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellID, _,_, auraType = ...\n        \n        if subEvent == \"SPELL_AURA_APPLIED\"\n        and spellID == 361745 then\n            aura_env.counter = aura_env.counter + 1\n            if aura_env.counter == 1 then\n                C_Timer.After(0.1, function() WeakAuras.ScanEvents(\"JACKTHEEGG\", spellID) end)\n                aura_env.order = {}\n            end\n            local subRole = aura_env.hasMRT and aura_env.convert[VExRT.ExCD2.gnGUIDs[destName]]\n            if subRole then\n                if subRole == \"Melee\" then\n                    table.insert(aura_env.order, 1, destName)\n                else\n                    table.insert(aura_env.order, destName)\n                end\n            end\n            \n        elseif event == \"SPELL_AURA_REMOVED\"\n        and spellID == 361745\n        and allstates[destName] then\n            allstates[destName].show = false\n            allstates[destName].changed = true\n            return true\n        end\n        \n    elseif event == \"JACKTHEEGG\" and ... then\n        local spellID = ...\n        aura_env.counter = 0\n        for k,v in pairs(aura_env.order) do\n            if v == WeakAuras.me then\n                local _, _, _, _, duration, expirationTime = GetPlayerAuraBySpellID(spellID)\n                if duration\n                and expirationTime then\n                    allstates[WeakAuras.me] = {\n                        show = true,\n                        changed = true,\n                        progressType = \"timed\",\n                        duration = duration,\n                        expirationTime = expirationTime,\n                        mark = \"|TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\"..aura_env.config[tostring(k)]..\":16|t\",\n                        markNum = tonumber(aura_env.config[tostring(k)]),\n                        autoHide = true,\n                    }\n                    return true\n                end    \n            end\n        end\n        \n    elseif event == \"ENCOUNTER_START\" then\n        aura_env.order = {}\n        aura_env.counter = 0\n    end\nend",
