				["init"] = {
					["custom"] = "aura_env.frame_pool = CreateFramePool(\"Frame\")\nC_ChatInfo.RegisterAddonMessagePrefix(\"BDGG_AMOGUS\")\n\nlocal whitelist = {\n    [181399] = true, -- Kintessa\n    [181398] = true, -- Mal'Ganis\n    [183138] = true, -- Inchoate Shadow\n    [169421] = true, -- Felguard (Necrolord Demon Hunter)\n    [169425] = true, -- Felhound (Necrolord Demon Hunter)\n    [169426] = true, -- Infernal (Necrolord Demon Hunter)\n    [169428] = true, -- Wrathguard (Necrolord Demon Hunter)\n    [169429] = true, -- Shivarra (Necrolord Demon Hunter)\n    [169430] = true, -- Ur'zul (Necrolord Demon Hunter)\n    [168932] = true, -- Doomguard (Necrolord Demon Hunter)\n    [186150] = true, -- Lost Soul (Jailer weapon)\n}\n\nfunction aura_env.UnitShouldShow(unit)\n    local npcID = tonumber(select(6, strsplit(\"-\", UnitGUID(unit))), 10)\n    return npcID and whitelist[npcID]\nend\n\n-- Altered version of LibGetFrame\nfunction aura_env.GetUnitNameplate(unit)\n    if not unit then return end\n    \n    local nameplate = C_NamePlate.GetNamePlateForUnit(unit)\n    \n    if nameplate then\n        if nameplate.unitFrame and nameplate.unitFrame.Health then\n            -- ElvUI\n            return nameplate.unitFrame\n        elseif nameplate.unitFramePlater then\n            -- Plater\n            return nameplate.unitFramePlater\n        elseif nameplate.kui then\n            -- Kui\n            return nameplate.kui\n        elseif nameplate.extended then\n            -- NeatPlates/TidyPlates\n            return nameplate.extended.visual.healthbar\n        elseif nameplate.TPFrame then\n            -- TidyPlates: Threat Plates\n            return nameplate.TPFrame.visual.healthbar\n        elseif bdUI and bdUI.using_nameplates then\n            -- bdUI\n            return bdUI:get_nameplate(unit)\n        elseif nameplate.ouf then\n            -- bdNameplates\n            return nameplate.ouf\n        elseif nameplate.UnitFrame then\n            -- Default\n            return nameplate.UnitFrame\n        else\n            return nameplate\n        end\n    end\nend",
					["do_custom"] = true,
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["debuffType"] = "HELPFUL",
						["custom_type"] = "stateupdate",
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["names"] = {
						},
						["spellIds"] = {
						},
						["custom"] = "function(allstates, event, ...)\n    if event == \"OPTIONS\" then\n        allstates[\"\"] = {\n            show = true,\n            votes = 0\n        }\n    elseif event == \"ENCOUNTER_START\" then\n        aura_env.reported = {} -- GUIDs of players that you have reported yourself\n        aura_env.imposters = {} -- GUIDs of players that have received 3 or more votes\n        aura_env.votes = {} -- Number of votes per player, as well as a list of players that voted for them\n        aura_env.imposterCount = 0 -- Number of players that have received 3 or more votes\n        aura_env.GUID2Unit = {}\n        \n        for unit in WA_IterateGroupMembers() do\n            aura_env.GUID2Unit[UnitGUID(unit)] = unit\n        end\n    elseif event == \"BDGG_AMOGUS_REPORT\" and ... then -- Reported someone\n        local unit = ...\n        local GUID = UnitGUID(unit)\n        aura_env.reported[GUID] = true\n        \n        local s = allstates[GUID]\n        \n        if s then\n            s.show = false\n            s.changed = true\n            \n            return true\n        end\n    elseif event == \"NAME_PLATE_UNIT_ADDED\" and ... then\n        local unit = ...\n        local GUID = UnitGUID(unit)\n        \n        if UnitCanAttack(\"player\", unit) then\n            -- Delay hiding nameplate so addons have the chance to do their things first\n            local showNameplate = aura_env.imposters[GUID]\n            C_Timer.After(0.2, function() WeakAuras.ScanEvents(\"BDGG_AMOGUS_NAMEPLATE\", unit, showNameplate) end)\n            \n            if UnitIsPlayer(unit) and UnitGroupRolesAssigned(\"player\") ~= \"TANK\" and UnitGroupRolesAssigned(unit) ~= \"TANK\" and not aura_env.reported[GUID] and not aura_env.imposters[GUID] and aura_env.imposterCount < 2 then\n                allstates[GUID] = {\n                    show = true,\n                    changed = true,\n                    unit = unit,\n                    votes = aura_env.votes[GUID] and aura_env.votes[GUID].count or 0,\n                    mouseover = false,\n                    autoHide = false\n                }\n                \n                return true\n            end\n        end\n    elseif event == \"NAME_PLATE_UNIT_REMOVED\" and ... then\n        local unit = ...\n        local GUID = UnitGUID(unit)\n        \n        local s = allstates[GUID]\n        \n        if s then\n            s.show = false\n            s.changed = true\n            \n            return true\n        end\n    elseif event == \"UNIT_SPELLCAST_START\" then\n        local _, _, spellID = ...\n        \n        if spellID == 360717 then\n            aura_env.reported = {}\n            aura_env.imposters = {}\n            aura_env.votes = {}\n            aura_env.imposterCount = 0\n            \n            for _, state in pairs(allstates) do\n                state.show = false\n                state.changed = true\n            end\n            \n            return true\n        end\n    elseif event == \"CHAT_MSG_ADDON\" and ... then\n        local prefix, GUID, _, sender = ...\n        \n        if prefix == \"BDGG_AMOGUS\" and GUID then\n            if not aura_env.votes[GUID] then\n                aura_env.votes[GUID] = {count = 0, voters = {}}\n            end\n            \n            if aura_env.votes[GUID].voters[sender] then return end -- The sender already voted on this player before\n            \n            aura_env.votes[GUID].count = aura_env.votes[GUID].count + 1\n            aura_env.votes[GUID].voters[sender] = true\n            \n            -- 3 votes means the imposter was found\n            if aura_env.votes[GUID].count == 3 then\n                aura_env.imposters[GUID] = true\n                aura_env.imposterCount = aura_env.imposterCount + 1\n                \n                -- Can't get hostile nameplate by raid unitID, so have to scan nameplates\n                for _, nameplate in pairs(C_NamePlate.GetNamePlates()) do\n                    local unit = nameplate.namePlateUnitToken\n                    \n                    if UnitGUID(unit) == GUID then\n                        WeakAuras.ScanEvents(\"BDGG_AMOGUS_NAMEPLATE\", unit, true)\n                        break\n                    end\n                end\n                \n                -- If we've found both imposters, hide all buttons\n                if aura_env.imposterCount == 2 then\n                    for _, state in pairs(allstates) do\n                        state.show = false\n                        state.changed = true\n                    end\n                    \n                    return true\n                else -- If we've only found 1, just hide their button\n                    local s = allstates[GUID]\n                    \n                    if s then\n                        s.show = false\n                        s.changed = true\n                        \n                        return true\n                    end\n                end\n            else\n                local s = allstates[GUID]\n                \n                if s then\n                    s.votes = aura_env.votes[GUID].count\n                    s.changed = true\n                    \n                    return true\n                end\n            end\n        end\n    elseif event == \"BDGG_AMOGUS_MOUSEOVER\" and ... then\n        local GUID, inside = ...\n        \n        local s = allstates[GUID]\n        \n        if s then\n            s.mouseover = inside\n            s.changed = true\n            \n            return true\n        end\n    elseif event == \"BDGG_AMOGUS_NAMEPLATE\" and ... then\n        local unit, show = ...\n        \n        if UnitExists(unit) then\n            local frame = aura_env.GetUnitNameplate(unit)\n            \n            if frame then\n                if show or aura_env.UnitShouldShow(unit) then\n                    frame:Show()\n                else\n                    frame:Hide()\n                end\n            end\n        end\n    end\nend",
