				["init"] = {
					["custom"] = "aura_env.powers = {\n  TANK = {\n    sog = {357524,357778,356828},\n    ark = {357575,357897,357839},\n    oros = {357834,357817,357820},\n    var = {357575,357863,357604}\n  },\n  \n  HEALER = {\n    sog = {357524,357556,356827},\n    ark = {357575,357900,357889},\n    oros = {357815,357842,357829},\n    var = {357575,357747,357847}\n  },\n  \n  DAMAGER = {\n    sog = {357524,356828,356827},\n    ark = {357575,357864,357848},\n    oros = {357814,357825,357834},\n    var = {357575,357609,357706}\n  }\n}\n\naura_env.bossNames = { \n  sog = \"Soggodon the Breaker\",\n  ark = \"Incinerator Arkolath\",\n  oros = \"Oros Coldheart\",\n  var = \"Executioner Varruth\"\n}\naura_env.uniqueSpells = {\n  TANK = {\n    [357524] = \"sog\",\n    [357839] = \"ark\",\n    [357820] = \"oros\",\n    [357604] = \"var\",\n  },\n  HEALER = {\n    [357524] = \"sog\",\n    [357889] = \"ark\",\n    [357829] = \"oros\",\n    [357747] = \"var\",\n  },\n  DAMAGER = {\n    [357524] = \"sog\",\n    [357848] = \"ark\",\n    [357814] = \"oros\",\n    [357706] = \"var\",\n  },\n}\n\n\nlocal debug = false\naura_env.debug = function(s)\n  if debug then\n    print(s)\n  end\nend\n\naura_env.printReminder = function()\n  local _, affixes = C_ChallengeMode.GetActiveKeystoneInfo()\n  if affixes then\n    local output1 = \"|cffff9f40Slotted affixes:|r\"\n    for i = 1, #affixes do \n      local name, _, icon = C_ChallengeMode.GetAffixInfo(affixes[i])\n      icon = (\"|T%d:0|t\"):format(icon)\n      output1 = (\"%s\\n %s%s\"):format(output1, icon, name)\n    end\n    \n    local output2 = \"|cffff9f40Currently selected auto-pick Powers:|r\"\n    local role = UnitGroupRolesAssigned(\"player\")\n    role = role == \"NONE\" and GetSpecializationRole(GetSpecialization()) or role\n    for boss,bossT in pairs(aura_env.config) do\n      if type(bossT) == \"table\" and bossT[role] then\n        if bossT[role] == 4 then\n          output2 = (\"%s\\n %s = |cffff5555<Manual Selection>|r\"):format(output2, aura_env.bossNames[boss])\n        else\n          local spell = aura_env.powers[role][boss][bossT[role]]\n          local link = GetSpellLink(spell)\n          local icon = GetSpellTexture(spell)\n          icon = (\"|T%d:0|t\"):format(icon)\n          output2 = (\"%s\\n %s = %s%s\"):format(output2, aura_env.bossNames[boss], icon, link)\n        end\n      end\n    end\n    print(\"|cffff9f40M+ Tormented AutoPicker Reminder!|r\")\n    print(output1)\n    print(output2)\n  end\nend\n\naura_env.getBossSelection = function(data, role)\n  for i, choice in ipairs(data.options) do\n    local boss = aura_env.uniqueSpells[role][choice.spellID]\n    if boss then\n      return boss, aura_env.config[boss][role]\n    end\n  end\nend\n\n\n",
