						["custom"] = "function(states, event, ...)\n    if event == \"OPTIONS\" then\n        states[\"\"] = {\n            name = format(\"GRP %s\", 1),\n            icon = 517163,\n            duration = 3.6,\n            expirationTime = GetTime() + 3.6,\n            progressType = \"timed\",\n            autoHide = true,\n            changed = true,\n            show = true,\n        }\n        return true\n    end\n    \n    if event == \"ENCOUNTER_START\" and ... then\n        aura_env.MRT()\n        aura_env.count = 0\n        \n        --local i = UnitInRaid(\"player\")\n        --aura_env.player = i and \"raid\"..i\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, message, _, srcGUID, srcName, _, _, destGUID, destName, _, _, spellid = ...\n        if message == \"SPELL_CAST_SUCCESS\" and spellid == 363893 then --Martyrdom\n            aura_env.count = aura_env.count + 1\n            \n            local count = aura_env.count%2\n            count = count == 0 and 2 or count\n            \n            if count then\n                states[\"\"] = {\n                    name = format(\"GRP %s\", count),\n                    icon = 517163,\n                    duration = 3.6,\n                    expirationTime = GetTime() + 3.6,\n                    progressType = \"timed\",\n                    autoHide = true,\n                    changed = true,\n                    show = true,\n                }\n                \n                local i = UnitInRaid(\"player\")\n                local player = i and \"raid\"..i\n                \n                if aura_env.list[count] and aura_env.list[count][player] then\n                    WeakAuras.ScanEvents(\"MATYR_SOAK\", true)\n                end\n                return true\n            end\n        end\n    end\nend",
