			["actions"] = {
				["start"] = {
					["do_custom"] = false,
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "local aura_env = aura_env\n\nif not IsAddOnLoaded(\"MythicDungeonTools\") then\n    LoadAddOn(\"MythicDungeonTools\")\n    \n    if not MDT then\n        return\n    end\nend\n\nlocal relic_options = {\n    [1] = \"urh\",\n    [2] = \"vy\",\n    [3] = \"wo\",\n}\n\nlocal dungeon_timers = {\n    [29] = 2580, -- DoS\n    [30] = 1920, -- HoA\n    [31] = 1800, -- MoTS\n    [32] = 2280, -- PF\n    [33] = 2460, -- SD\n    [34] = 2340, -- SoA\n    [35] = 2160, -- NW\n    [36] = 2220, -- ToP\n    [37] = 2280, -- TazaLower\n    [38] = 1800, -- TazaUpper\n}\n\naura_env.export_func = function(mult)\n    mult = tonumber(mult)\n    if not mult then\n        print(\"percent must be number\")\n        return\n    else\n        if mult < 1 or mult > 100 then\n            print(\"percent must be in the 1 to 100 range\")\n            return\n        end\n    end\n    \n    local preset = MDT:GetCurrentPreset()\n    local pulls = MDT:GetPulls(preset)\n    local difficulty = preset.difficulty\n    local dungeon = MDT:GetDungeonName(preset.value.currentDungeonIdx)\n    local time_limit = dungeon_timers[preset.value.currentDungeonIdx]\n    \n    local events = {}\n    \n    local pull_i = 1\n    for _, pull in pairs(pulls) do\n        \n        local delay = math.random(aura_env.config.min_delay, aura_env.config.max_delay)\n        local delay_str = string.format(\"%03d\", delay)\n        \n        local raid_event = \"raid_events+=/pull,pull=\"..string.format(\"%02d\", pull_i)..\",bloodlust=0,delay=\"..delay_str..\",relic=\"..relic_options[aura_env.config.relic]..\",enemies=\"\n        local e = 0\n        local manastorm_boss = 1\n        local managerie_boss = 1\n        local sub_pulls = 1\n        \n        if pull then\n            for enemy_idx, clones in pairs(pull) do\n                if tonumber(enemy_idx) and MDT.dungeonEnemies[preset.value.currentDungeonIdx][enemy_idx] then\n                    local enemy = MDT.dungeonEnemies[preset.value.currentDungeonIdx][enemy_idx]\n                    -- skip Volatile Memory\n                    if enemy.id ~= 170147 then\n                        local c = 1\n                        for _, clone_idx in pairs(clones) do\n                            if enemy.clones[clone_idx] and MDT:IsCloneIncluded(enemy_idx, clone_idx) then\n                                \n                                local health = MDT:CalculateEnemyHealth(enemy.isBoss ~= nil, enemy.health, difficulty, enemy.ignoreFortified)\n                                \n                                if (enemy.isBoss or not enemy.ignoreFortified) and preset.value.currentDungeonIdx < 37 then\n                                    -- mdt doesn't account for the seasonal health buffs\n                                    -- seems it does now?\n                                    --health = health * 1.39 * 1.46\n                                end\n                                \n                                health = health * (mult / 100)\n                                \n                                -- Mueh'zala\n                                if (enemy.id == 166608) then\n                                    health = health * 0.1\n                                end\n                                \n                                -- General Kaal\n                                if (enemy.id == 162099) then\n                                    health = health * 0.2\n                                end\n                                \n                                if enemy.id == 164556 or enemy.id == 164555 then\n                                    \n                                    -- Manastorms, separate into 2 pulls so they're not simmed together as a 2 target fight, TODO relics\n                                    sub_pulls = 2\n                                    local fixed_health = health * 0.9\n                                    local fixed_name = string.gsub(enemy.name, \" \", \"_\")\n                                    \n                                    if manastorm_boss == 1 then\n                                        if e > 0 then\n                                            raid_event = raid_event..\"|\"\n                                        end\n                                        e = e + 1\n                                        raid_event = raid_event..\"\\\"\"..fixed_name..\"\\\":\"..floor(fixed_health)\n                                        manastorm_boss = 2\n                                    else\n                                        local new_pull = pull_i + (manastorm_boss - 1)\n                                        events[new_pull] = \"raid_events+=/pull,pull=\"..string.format(\"%02d\", new_pull)..\",bloodlust=0,delay=000,relic=\"..relic_options[aura_env.config.relic]..\",enemies=\"..\"\\\"\"..fixed_name..\"\\\":\"..floor(fixed_health)\n                                    end\n                                    \n                                elseif enemy.id == 176556 or enemy.id == 176705 or enemy.id == 176555 then\n                                    \n                                    -- Grand Managerie, separate into 3 pulls so they're not simmed together as a 3 target fight,\n                                    sub_pulls = 3\n                                    local fixed_name = string.gsub(enemy.name, \" \", \"_\")\n                                    \n                                    if managerie_boss == 1 then\n                                        if e > 0 then\n                                            raid_event = raid_event..\"|\"\n                                        end\n                                        e = e + 1\n                                        raid_event = raid_event..\"\\\"\"..fixed_name..\"\\\":\"..floor(health)\n                                        managerie_boss = 2\n                                    else\n                                        local new_pull = pull_i + (managerie_boss - 1)\n                                        events[new_pull] = \"raid_events+=/pull,pull=\"..string.format(\"%02d\", new_pull)..\",bloodlust=0,delay=000,relic=\"..relic_options[aura_env.config.relic]..\",enemies=\"..\"\\\"\"..fixed_name..\"\\\":\"..floor(health)\n                                        managerie_boss = 3\n                                    end\n                                    \n                                elseif enemy.id == 185680 or enemy.id == 185685 or enemy.id == 185683 then\n                                    \n                                    if e > 0 then\n                                        raid_event = raid_event..\"|\"\n                                    end\n                                    e = e + 1\n                                    local fixed_name = string.gsub(enemy.name, \"\\\"\", \"`\")\n                                    fixed_name = string.gsub(fixed_name, \"%:\", \"\")\n                                    fixed_name = string.gsub(fixed_name, \" \", \"_\")\n                                    fixed_name = string.gsub(fixed_name, \",\", \"\")\n                                    \n                                    raid_event = raid_event..\"\\\"RELIC_\"..fixed_name..\"\\\":\"..floor(health)\n                                    \n                                else\n                                    \n                                    local unit = enemy.isBoss and \"\" or \"_\"..c\n                                    c = c + 1\n                                    if e > 0 then\n                                        raid_event = raid_event..\"|\"\n                                    end\n                                    e = e + 1\n                                    \n                                    local fixed_name = string.gsub(enemy.name, \"\\\"\", \"`\")\n                                    fixed_name = string.gsub(fixed_name, \"%:\", \"\")\n                                    fixed_name = string.gsub(fixed_name, \" \", \"_\")\n                                    fixed_name = string.gsub(fixed_name, \",\", \"\")\n                                    \n                                    raid_event = raid_event..\"\\\"\"..fixed_name..unit..\"\\\":\"..floor(health)\n                                    \n                                end\n                            end\n                        end\n                    end\n                end\n            end\n        end\n        \n        if e > 0 then\n            events[pull_i] = raid_event\n            pull_i = pull_i + sub_pulls\n        end\n        \n    end\n    \n    local text = \"\"\n    \n    text = text..\"fight_style=DungeonRoute\\n\"\n    text = text..\"override.bloodlust=0\\n\"\n    text = text..\"override.arcane_intellect=0\\n\"\n    text = text..\"override.power_word_fortitude=0\\n\"\n    text = text..\"override.battle_shout=0\\n\"\n    text = text..\"override.mystic_touch=0\\n\"\n    text = text..\"override.chaos_brand=0\\n\"\n    text = text..\"override.bleeding=0\\n\"\n    \n    text = text..\"single_actor_batch=1\\n\"\n    text = text..\"max_time=\"..time_limit..\"\\n\"\n    text = text..\"enemy=\\\"\"..dungeon..\" \"..difficulty..\" \"..(MDT:IsCurrentPresetFortified() and \"Fortified\" or \"Tyrannical\")..\"\\\"\\n\"\n    text = text..\"enemy_health=999999\\n\"\n    text = text..\"keystone_level=\"..MDT:GetCurrentPreset().difficulty..\"\\n\"\n    text = text..\"keystone_pct_hp=\"..mult..\"\\n\"\n    text = text..\"raid_events=/invulnerable,cooldown=\"..(time_limit * 2)..\",duration=\"..(time_limit * 2)..\",retarget=1\"\n    for _, event in pairs(events) do\n        text = text..\"\\n\"..event\n    end\n    \n    aura_env.scroll:GetScrollChild():SetText(text)\n    aura_env.scroll:GetScrollChild():HighlightText()\n    aura_env.scroll:Show()\nend\n\n-- copyable text window containing export\nif aura_env.scroll then aura_env.scroll:Hide() end\n\naura_env.scroll = CreateFrame('ScrollFrame', nil, UIParent, 'UIPanelScrollFrameTemplate')\naura_env.scroll:SetFrameStrata(\"TOOLTIP\")\naura_env.scroll:SetPoint(\"CENTER\")\naura_env.scroll:SetSize(1200, 600)\naura_env.scroll:EnableMouse(true)\n\nlocal bg = aura_env.scroll:CreateTexture(nil, \"BACKGROUND\")\nbg:SetAllPoints()\nbg:SetColorTexture(0, 0, 0, 1)\n\nlocal edit = CreateFrame('EditBox', nil, aura_env.scroll)\nedit:SetSize(1200, 600)\nedit:SetMultiLine(true)\nedit:SetMaxLetters(99999)\nedit:EnableMouse(true)\nedit:SetFontObject(ChatFontNormal)\nedit:SetScript('OnEscapePressed', function()\n        aura_env.scroll:Hide()\nend)\naura_env.scroll:SetScrollChild(edit)\naura_env.scroll:Hide()\n\n-- button attached to MDT window to trigger an export\nif aura_env.button then aura_env.button:Hide() end\n\naura_env.button = CreateFrame(\"Button\", nil, UIParent, \"UIPanelButtonTemplate\")\naura_env.button:SetSize(120, 20)\naura_env.button:SetText(\"SimC Export\")\naura_env.button:Hide()\n\naura_env.input = CreateFrame('EditBox', nil, aura_env.button, \"InputBoxTemplate\")\naura_env.input:SetMaxLetters(3)\naura_env.input:EnableMouse(true)\naura_env.input:SetFontObject(ChatFontNormal)\naura_env.input:SetSize(60, 20)\naura_env.input:SetText(\"27\")\naura_env.input:SetAutoFocus(false)\naura_env.input:SetPoint(\"BOTTOMRIGHT\", aura_env.button, \"BOTTOMLEFT\")\n\nlocal label = aura_env.input:CreateFontString(nil, \"ARTWORK\", \"ChatFontNormal\")\nlabel:SetText(\"mob health %:\")\nlabel:SetPoint(\"RIGHT\", aura_env.input, \"LEFT\", -5, 0)\n\naura_env.button:SetScript(\"OnClick\", function() aura_env.export_func(aura_env.input:GetText()) end)\n\nif MDTSidePanel and MDTSidePanel:IsShown() then \n    aura_env.button:SetParent(MDTSidePanel)\n    aura_env.button:SetPoint(\"BOTTOMRIGHT\", MDTSidePanel, \"TOPRIGHT\")\n    aura_env.button:Show()\nend\n\nif not MDT.simc_export_hooked then\n    MDT.simc_export_hooked = true\n    hooksecurefunc(MDT, \"ShowInterface\", function()\n            aura_env.button:SetParent(MDTSidePanel)\n            aura_env.button:SetPoint(\"BOTTOMRIGHT\", MDTSidePanel, \"TOPRIGHT\")\n            aura_env.button:Show()\n    end)\nend",
