						["events"] = "CLEU:SPELL_AURA_APPLIED:SPELL_CAST_SUCCESS DOMINATION_CHECK",
						["names"] = {
						},
						["check"] = "event",
						["custom"] = "function(states, event, ...)\n    if event == \"OPTIONS\" then\n        local duration = 5.8\n        states[\"\"] = {\n            name = \"Player 1\",\n            side = aura_env.sides[1],\n            icon = 4005158,\n            player = true,\n            duration = duration,\n            expirationTime = duration + GetTime(),\n            progressType = \"timed\",\n            autoHide = true,\n            changed = true,\n            show = true,\n            index = 1,\n        }\n        for i = 2, 3 do\n            states[i] = {\n                name = \"Player \"..i,\n                side = aura_env.sides[i],\n                icon = 4005158,\n                player = false,\n                duration = duration,\n                expirationTime = duration + GetTime(),\n                progressType = \"timed\",\n                autoHide = true,\n                changed = true,\n                show = true,\n                index = i,\n            }\n        end\n        local aura_env = aura_env\n        C_Timer.After(0.01, function()\n                aura_env.sortAndOffset()\n        end)\n        return true\n    end\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and ... then\n        local _, message, _, srcGUID, srcName, _, _, destGUID, destName, _, _, spellid = ...\n        if message == \"SPELL_CAST_SUCCESS\" then\n            if aura_env.mcasts[spellid] and not aura_env.melee[srcGUID] then\n                aura_env.melee[srcGUID] = true\n            end\n        elseif message == \"SPELL_AURA_APPLIED\" and spellid == 365150 then --Rune of Domination\n            local theTime = GetTime()\n            if not aura_env.last or aura_env.last < theTime - 5 then\n                aura_env.last = theTime\n                aura_env.count = 1\n                aura_env.affected = {}\n                \n                C_Timer.After(0.2, function()\n                        WeakAuras.ScanEvents(\"DOMINATION_CHECK\", true)\n                end)\n            end\n            \n            local i = UnitInRaid(destName)\n            local unit = i and \"raid\"..i\n            if unit then\n                local combatType = aura_env.check(unit)\n                combatType = combatType or \"r\"\n                \n                table.insert(aura_env.affected, {unit, combatType})\n                aura_env.count = aura_env.count + 1\n            end\n        end\n    elseif event == \"DOMINATION_CHECK\" and ... then\n        table.sort(aura_env.affected, function(a, b) return a[2] > b[2] end) --range 1st\n        \n        for i, data in ipairs(aura_env.affected) do\n            local unit, combatType = data[1], data[2]\n            if unit then\n                local name = WA_ClassColorName(unit)\n                local side = aura_env.sides[i]\n                local player = UnitIsUnit(\"player\", unit)\n                local duration = 5.8\n                states[i] = {\n                    name = name,\n                    unit = unit,\n                    player = player,\n                    side = side,\n                    duration = duration,\n                    expirationTime = duration + GetTime(),\n                    progressType = \"timed\",\n                    autoHide = true,\n                    changed = true,\n                    show = true,\n                    index = i,\n                }\n                if player then\n                    WeakAuras.ScanEvents(\"DOMINATION_ME\", i)\n                end\n            end\n        end\n        return true\n    end\nend",
